import React from "react";
import logo from "../logo.svg";
import { Link, animateScroll as scroll } from "react-scroll";

const Navbar = ( setFocus ) => {
  return (
    <nav className="nav" id="navbar">
      <div className="nav-content">
        <img
          src={logo}
          className="nav-logo"
          alt="Logo"
          onClick={scroll.scrollToTop}
        />
        <ul className="nav-items">
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section1"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
              onClick={setFocus({
                about: true,
                resume: false,
                portfolio: false
              })}
            >
              About
            </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section2"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
              onClick={setFocus({
                about: false,
                resume: true,
                portfolio: false
              })}
            >
              Resume
            </Link>
          </li>
          <li className="nav-item">
            <Link
              activeClass="active"
              to="section3"
              spy={true}
              smooth={true}
              offset={-45}
              duration={750}
            >
              Portfolio
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
}
export default Navbar;
